(1, 'FAQs', 'faqs', '<h2>Help</h2>\r\n\r\n<p>How to Create an Account?</p>\r\n\r\n<p>If you don&#39;t have an bnbtoronto account yet, go to <strong>bnbtoronto.com</strong> and click Sign Up.</p>\r\n\r\n<p>You can sign up for an account using your email address, phone number, <a href="https://www.airbnb.com/help/article/113/">Facebook account</a>, Google account, or <a href="https://www.airbnb.com/help/article/2678/">Apple ID</a>. Signing up and creating an Airbnb account is free.</p>\r\n\r\n<p>After you sign up, be sure to <a href="https://www.airbnb.com/help/article/1170">complete your account</a> before booking a reservation.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Section 2</p>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>\r\n\r\n<p>Section 3</p>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>', 'first', 'Active', 1, 0, 0, NULL, '2021-08-19 13:11:48'),
(2, 'About', 'about', '<h2><strong>About</strong> (not final)</h2>\r\n\r\n<h3><em><img alt="" src="http://bnbtoronto.ca/public/images/2128background-3.jpg" style="float:left; height:113px; width:200px" />Created from a community of super hosts we provide quality, and affordable&nbsp;accommodations. We achieved an easy, secure and fast online booking experience . Since 2019, Our mission has helped thousands of guests find accommodations. From booking to taking a trip and to find every traveler the space they need to relax, reconnect, and enjoy precious time away together.</em></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Our website has a verification process that helps the host and guest be more comfortable with each other. &nbsp;</em></p>\r\n\r\n<p><img alt="" src="http://bnbtoronto.ca/public/images/3506background 2.jpg" style="height:1036px; width:1500px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Our goal is to be the premier exclusive local provider of short term accommodations</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><img alt="" src="http://bnbtoronto.ca/public/images/4628BNB Toronto Logo (1).jpg" style="height:178px; width:293px" /></em></p>', 'first', 'Active', 0, 0, 0, NULL, '2021-07-20 03:41:06'),
(3, 'Policies', 'policies', '<h2>Policies</h2>\r\n\r\n<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&#39;t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn&#39;t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p>', 'second', 'Active', 0, 0, 0, NULL, '2021-06-08 13:11:52'),
(4, 'Privacy', 'privacy', '<h2><em><strong><img alt="" src="http://bnbtoronto.ca/public/images/2798host123.jpg" /></strong></em></h2>\r\n\r\n<h2><em><strong>Privacy Statement and Cookie Statement</strong></em></h2>\r\n\r\n<p><em>Last Updated: August 21, 2020</em></p>\r\n\r\n<p><em>&nbsp;values you as our customer and recognizes that privacy is important to you. This Privacy Statement explains how we collect, use, and disclose data when you use our platform and associated services, and tells you how to contact us.</em></p>\r\n\r\n<p><em><strong>Privacy Statement Summary</strong></em></p>\r\n\r\n<p><em>This is a summary of our Privacy Statement. To review our Privacy Statement in full, please scroll down.</em></p>\r\n\r\n<h3><em><strong>What does this Privacy Statement cover?</strong></em></h3>\r\n\r\n<p><em>This Privacy Statement is designed to describe:</em></p>\r\n\r\n<ul>\r\n	<li><em>How and what type of personal information we collect and use</em></li>\r\n	<li><em>When and with whom we share your personal information</em></li>\r\n	<li><em>What choices you can make about how we collect, use, and share your personal information</em></li>\r\n</ul>\r\n\r\n<h3><em><strong>What personal information do we collect and use, and how do we collect it?</strong></em></h3>\r\n\r\n<p><em>We collect personal information when:</em></p>\r\n\r\n<ul>\r\n	<li><em>You give us the information</em></li>\r\n	<li><em>We collect it automatically</em></li>\r\n	<li><em>We receive it from others</em></li>\r\n</ul>\r\n\r\n<p><em>When you create an account on our sites, sign up to receive offers or information, or make a booking using our platform, you give us your personal information. We also collect such information through automated technology such as cookies placed on your browser&mdash;with your consent where applicable&mdash;when you visit our sites. We also receive information from affiliated companies within Expedia Group as well as from business partners and other third parties, which helps us improve our platform and associated tools and services, update and maintain accurate records, detect and investigate potential fraud, and more effectively market our services.</em></p>\r\n\r\n<h3><em><strong>How is your personal information shared?</strong></em></h3>\r\n\r\n<p><em>Your personal information may be shared to help you make a booking, assist you with or during your&nbsp; stay, communicate with you (including when we send information about products and services or enable you to communicate with travel providers or property owners or managers), or to comply with the law. Our full Privacy Statement provides additional detail regarding how your personal information may be shared.</em></p>\r\n\r\n<h3><em><strong>What are your rights and choices?</strong></em></h3>\r\n\r\n<p><em>You can exercise your data-protection rights in various ways. For example, you can opt out of marketing by clicking the &ldquo;unsubscribe&rdquo; link in emails you receive, changing preferences in your account, as applicable, or by contacting our customer service team. Our Privacy Statement has more information about the options and data-protection rights available to you.</em></p>\r\n\r\n<h3><em><strong>How to contact us</strong></em></h3>\r\n\r\n<p><em>More information about our privacy practices is in our full Privacy Statement. You can also contact us as described below in the Contact Us section to ask questions about how we handle your personal information or to make requests about your personal information.</em></p>\r\n\r\n<p><em>*****************************</em></p>\r\n\r\n<h2><em><strong>Privacy Statement</strong></em></h2>\r\n\r\n<p><em>Categories of Personal Information We Collect</em></p>\r\n\r\n<p><em>Use of Personal Information</em></p>\r\n\r\n<p><em>Sharing of Personal Information</em></p>\r\n\r\n<p><em>Your Rights and Choices</em></p>\r\n\r\n<p><em>International Data Transfer &amp; Privacy Shield</em></p>\r\n\r\n<p><em>Security</em></p>\r\n\r\n<p><em>Record Retention</em></p>\r\n\r\n<p><em>Cookie Statement</em></p>\r\n\r\n<p><em>Contact Us</em></p>\r\n\r\n<p><em>Updates to Privacy Statement</em></p>\r\n\r\n<p><em><strong>Categories of Personal Information We Collect</strong></em></p>\r\n\r\n<p><em>When you use our platform we may collect the following kinds of personal information from you:</em></p>\r\n\r\n<ul>\r\n	<li><em>Name, email address, telephone number; and home, business, and billing addresses</em></li>\r\n	<li><em>Government-issued identification as required for booking or identity verification, such as passport, driver&rsquo;s license, and government redress numbers; and for vacation-property owners and managers, tax identification numbers</em></li>\r\n	<li><em>Payment information such as payment card number, expiration date, and billing address</em></li>\r\n	<li><em>Travel-related preferences and requests such as favorite destinations and accommodation types, and special dietary and accessibility needs, as available</em></li>\r\n	<li><em>Loyalty program and membership information</em></li>\r\n	<li><em>Birth date and gender</em></li>\r\n	<li><em>Geolocation</em></li>\r\n	<li><em>Images, videos, and other recordings</em></li>\r\n	<li><em>Social media account IDs and other publicly available information</em></li>\r\n	<li><em>Communications with us (such as recordings of calls with customer service representatives for quality assurance and training purposes)</em></li>\r\n	<li><em>Searches you conduct, transactions into which you enter, and other interactions with you on or through our websites and apps</em></li>\r\n	<li><em>Data you provide about other people, such as your travel companions or others for whom you are making a booking</em></li>\r\n</ul>\r\n\r\n<p><em>When you install any of our apps or use our platform, we automatically collect the following types of information from your device:</em></p>\r\n\r\n<ul>\r\n	<li><em>IP address</em></li>\r\n	<li><em>Device type</em></li>\r\n	<li><em>Unique device identification numbers</em></li>\r\n	<li><em>Internet browser-type (such as Firefox, Safari, Chrome, and Internet Explorer)</em></li>\r\n	<li><em>Internet Service Provider</em></li>\r\n	<li><em>Operating System</em></li>\r\n	<li><em>Mobile carrier</em></li>\r\n	<li><em>How your device has interacted with our online services, including pages accessed, links clicked, trips viewed, and features used, along with associated dates and times</em></li>\r\n	<li><em>Details of any referring website or exit pages, as well as general geographic location (such as at the country or city-level)</em></li>\r\n</ul>\r\n\r\n<p><em>Our Cookie Statement further explains how we use cookies and similar tracking technology.</em></p>\r\n\r\n<p><em><strong>Mobile Applications</strong></em></p>\r\n\r\n<p><em>When you download and use any of our mobile apps, we collect certain technical information from your device to enable the app to work properly and as otherwise described in this Privacy Statement. That technical information includes:</em></p>\r\n\r\n<ul>\r\n	<li><em>Device and telephone connectivity information such as your carrier, network type, network operator, subscriber identity module (&quot;SIM&quot;) operator, and SIM country</em></li>\r\n	<li><em>Operating system and version</em></li>\r\n	<li><em>Device model</em></li>\r\n	<li><em>Performance and data usage</em></li>\r\n	<li><em>Usage data, such as dates and times the app accesses our servers, the features and links clicked in the app, searches, transactions, and the data and files downloaded to the app</em></li>\r\n	<li><em>Device settings selected or enabled, such as Wi-Fi, Global Positioning System (&quot;GPS&quot;), and Bluetooth (which may be used for location services, subject to your permission as explained below)</em></li>\r\n	<li><em>Mobile device settings</em></li>\r\n	<li><em>Other technical information such as app name, type, and version as needed to provide you with services</em></li>\r\n</ul>\r\n\r\n<p><em><strong>Permissions for Location-Based Services:</strong></em></p>\r\n\r\n<p><em>Depending on your device&rsquo;s settings and permissions and your choice to participate in certain programs, we may collect the location of your device by using GPS signals, cell phone towers, Wi-Fi signals, Bluetooth or other technologies. We will collect this information, if you opt in through the app or other program (either during your initial login or later), to enable certain location-based services available within the app (for example, locating available lodging closest to you). To disable location capabilities of the app, you can log off or change your mobile device&rsquo;s settings.</em></p>\r\n\r\n<p><em><strong>Use of Personal Information</strong></em></p>\r\n\r\n<p><em>We use your personal information for various purposes described below, which depend on the site you visit or the app you use.</em></p>\r\n\r\n<p><em>Your Use of Online Sites, Apps, and Services:</em></p>\r\n\r\n<ul>\r\n	<li><em>Book the requested travel or enable vacation-property booking</em></li>\r\n	<li><em>Provide services related to the booking or account</em></li>\r\n	<li><em>Create, maintain, and update user accounts on our platform and authenticate you as a user</em></li>\r\n	<li><em>Maintain your search and travel history, accommodation and travel preferences, and similar information about your use of Expedia Group&rsquo;s platform and services, and as otherwise described in this Privacy Statement</em></li>\r\n	<li><em>Enable and facilitate acceptance and processing of payments, coupons, and other transactions</em></li>\r\n	<li><em>Administer loyalty and rewards programs</em></li>\r\n	<li><em>Collect and enable booking-related reviews</em></li>\r\n	<li><em>Help you to use our services faster and more easily through features such as the ability to sign-in using your account within the online services and sites of some of the Expedia Group companies</em></li>\r\n</ul>\r\n\r\n<p><em>Communications and Marketing:</em></p>\r\n\r\n<ul>\r\n	<li><em>Respond to your questions and requests for information, and process information choices</em></li>\r\n	<li><em>Enable communication between travelers and travel suppliers, such as hotels and vacation-property owners and managers</em></li>\r\n	<li><em>Contact you (such as by text message, email, phone call, mail, push notification, or messaging on other communication platforms) to provide information such as travel booking confirmations and updates, for marketing purposes, or for other purposes as described in this Privacy Statement</em></li>\r\n	<li><em>Market our products and services, optimize such marketing to be more relevant to you, and measure and analyze the effectiveness of our marketing and promotions</em></li>\r\n	<li><em>Administer promotions such as contests, sweepstakes, and similar giveaways</em></li>\r\n</ul>\r\n\r\n<p><em>Other Business Purposes and Compliance</em></p>\r\n\r\n<ul>\r\n	<li><em>Conduct surveys, market research, and data analytics</em></li>\r\n	<li><em>Maintain, improve, research, and measure the effectiveness of our sites and apps, activities, tools, and services</em></li>\r\n	<li><em>Monitor or record calls, chats, and other communications with our customer-service team and other representatives, as well as platform communications between or among partners and travelers for quality control, training, dispute resolution, and as otherwise described in this Privacy Statement</em></li>\r\n	<li><em>Create aggregated or otherwise anonymized or deidentified data, which we may use and disclose without restriction where permissible</em></li>\r\n	<li><em>Promote security, verify identity of our customers, prevent and investigate fraud and unauthorized activities, defend against claims and other liabilities, and manage other risks</em></li>\r\n	<li><em>Comply with applicable laws, protect our and our users&rsquo; rights and interests, defend ourselves, and respond to law enforcement, other legal authorities, and requests that are part of legal processes</em></li>\r\n	<li><em>Comply with applicable security and anti-terrorism, anti-bribery, customs and immigration, and other such due-diligence laws and requirements</em></li>\r\n	<li><em>Operate our business as permitted by law</em></li>\r\n</ul>\r\n\r\n<p><em><strong>Sharing of Personal Information</strong></em></p>\r\n\r\n<p><em>We share your personal information as described below and in this Privacy Statement, and as permitted by applicable law.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>&bull; <strong>Third-party service providers</strong>. We share personal information with third parties in connection with the delivery of services to you and the operation of our business (for example, to provide payment-card processing, customer service, business analytics, and fraud-prevention and compliance services, and to serve you with advertising tailored to your interests). These third-party service providers are required to protect personal information we share with them and may not use any directly identifying personal information other than to provide the services for which we have contracted them. They are not allowed to use the personal information we share for purposes of their own direct marketing (unless you have separately consented to such use under the terms provided by the third party).</em></p>\r\n\r\n<p><em>&bull; <strong>Travel suppliers</strong>. We share personal information with travel-related suppliers such as hotels, airlines, car-rental companies, insurance providers, vacation-rental property owners and managers, and where available, activity providers, and rail and cruise lines who fulfill your booking. Please note that travel suppliers may contact you to obtain additional information if and as required to facilitate your booking or to otherwise provide the travel or associated services.</em></p>\r\n\r\n<p><em>&bull; <strong>Business partners and offers</strong>. If we promote a program or offer a service or product in conjunction with a third-party business partner, we will share your information with that partner to assist in marketing or to provide the associated product or service. In most of those cases, the program or offer will include the name of the third-party business partner, either alone or with ours, or you will be redirected to the website of that business with notice. An example of such a business-partner relationship would be a third-party loyalty program for which you could earn points by completing a booking on our platform.</em></p>\r\n\r\n<p><em>&bull; <strong>Other third parties</strong>. When you access certain features such as Facebook&rsquo;s &ldquo;Like&rdquo; button, or use a single sign-on that allows you to login to our online services with your social-media credentials, you will share information with the social media company or other provider, such as the fact that you have visited or interacted with us. In the European Economic Area (EEA), Switzerland, and United Kingdom (UK) we will not load social-media sharing or sign-on buttons on our website unless and until you accept our use of cookies and similar technologies. For more information, see our Cookie Statement. The third-party provider may combine this information with other information they have about you. The personal information shared will be governed by the third-party provider&rsquo;s privacy policy (including any personal information we may access via the third-party provider). These third-party providers should inform you about how you can modify your privacy settings on their sites.</em></p>\r\n\r\n<p><em>&bull; <strong>Legal rights and obligations</strong>. We may disclose your personal information to enforce our policies, or where we are permitted (or believe in good faith that we are required) to do so by applicable law, such as in response to a request by a law enforcement or governmental authority, in connection with actual or proposed litigation, or to protect and defend our property, people, or other rights or interests. We may also share your personal information pursuant to a subpoena or other legal request, or as necessary to remit certain taxes in the course of processing payments as required by law or legal process.</em></p>\r\n\r\n<p><em>&bull; <strong>Corporate transactions</strong>. We may share your personal information in connection with a corporate transaction, such as a divestiture, merger, consolidation, assignment, or asset sale, or in the unlikely event of bankruptcy. In the case of an acquisition, we will inform the buyer that it may use your personal information only for the purposes disclosed in this Privacy Statement.</em></p>\r\n\r\n<p><em><strong>Your Rights and Choices</strong></em></p>\r\n\r\n<p><em>You have certain rights and choices with respect to your personal information, as described below:</em></p>\r\n\r\n<ul>\r\n	<li><em>If you have an account with us, you may change your communication preferences by either (1) logging in and updating the information in your account (not available for all Expedia Group companies) or (2) contacting us&nbsp;</em></li>\r\n	<li><em>You can control our use of certain cookies by following the guidance in our Cookie Statement.</em></li>\r\n	<li><em>You can update the accuracy of your information at any time by either logging into your account or contacting us</em></li>\r\n	<li><em>If you no longer wish to receive marketing and promotional emails, you may unsubscribe by clicking the &ldquo;unsubscribe&rdquo; link in the email. You can also log into your account to change communication settings (not available for all Expedia Group companies). Please note that if you choose to unsubscribe from or opt out of marketing emails, we may still send you important transactional and account-related messages from which you will not be able&nbsp;</em></li>\r\n	<li><em>For our mobile apps, you can view and manage notifications and preferences in the Settings menus of the apps and of your operating system</em></li>\r\n	<li><em>If we are processing your personal information on the basis of consent, you may withdraw that consent at any time by contacting us. Withdrawing your consent will not affect the lawfulness of any processing that occurred before you withdrew consent and it will not affect our processing of your personal information that is conducted in reliance on a legal basis other than consent</em></li>\r\n</ul>\r\n\r\n<p><em>For questions about privacy and your rights and choices, please contact us.</em></p>\r\n\r\n<p><em><strong>For California residents:</strong></em></p>\r\n\r\n<p><em>California residents may exercise the following rights:</em></p>\r\n\r\n<ul>\r\n	<li><em>To request a copy of your personal information</em></li>\r\n	<li><em>To request disclosure of personal information sold or disclosed for a business purpose</em></li>\r\n	<li><em>To request the deletion of personal information</em></li>\r\n</ul>\r\n\r\n<p><em><strong>International Data Transfer</strong></em></p>\r\n\r\n<p><em>The personal information we process may be transmitted or transferred to countries other than the country in which you reside. Those countries may have data-protection laws that are different from the laws of your country.</em></p>\r\n\r\n<p><em>The servers for our platform are located in the United States, and the Expedia Group companies and third-party service providers operate in many countries around the world. When we collect your personal information, we may process it in any of those countries.</em></p>\r\n\r\n<p><em>We have taken appropriate steps and put safeguards in place to help ensure that your personal information remains protected in accordance with this Privacy Statement. For example, any data transfers between Expedia Group companies are governed by our intragroup agreements, which incorporate strict data-transfer terms (including the European Commission&#39;s Standard Contractual Clauses, for transfers from the EEA) and require all group companies to protect the personal information they process in accordance with applicable data-protection law. In addition, certain Expedia Group U.S. affiliates have certified with the EU-U.S. and Swiss-U.S. Privacy Shield, as explained below in the &ldquo;Privacy Shield&ldquo; section.</em></p>\r\n\r\n<p><em>We also require that third-party service providers to whom a data transfer is made have appropriate safeguards in place to protect your personal information in compliance with applicable data protection law. The particular measures used will depend on the service provider, and our agreements with them may include European Commission approved Standard Contractual Clauses, the service provider&#39;s certification under the EU-U.S. or Swiss-U.S. Privacy Shield certification, or reliance on the service provider&#39;s Binding Corporate Rules, as defined by the European Commission.</em></p>\r\n\r\n<p><em><strong>Privacy Shield</strong></em></p>\r\n\r\n<p><em>Certain Expedia Group U.S. affiliates have certified to the EU-U.S. and Swiss-U.S. Privacy Shield frameworks and that we adhere to the Privacy Shield Principles of Notice, Choice, Accountability for Onward Transfers, Security, Data Integrity and Purpose Limitation, Access, and Recourse, Enforcement, and Liability for personal information from the EU, Switzerland, and the United Kingdom. Such Expedia Group U.S. affiliates will continue to adhere to the Privacy Shield frameworks and Principles even though the CJEU determined in July 2020 that the EU-U.S. Privacy Shield framework is no longer an adequate transfer mechanism for the transfer of EU personal information to the U.S. In addition, Expedia Group maintains intra-group Standard Contractual Clauses where applicable to cover the transfer of EU personal information to the U.S. Owant you to feel confident about using our platform and all associated tools and services, and we are committed to taking appropriate steps to protect the information we collect. While no company can guarantee absolute security, we do take reasonable steps to implement appropriate physical, technical, and organizational measures to protect the personal information that we collect and process.</em></p>\r\n\r\n<p><em><strong>Record Retention</strong></em></p>\r\n\r\n<p><em>We will retain your personal information in accordance with all applicable laws, for as long as it may be relevant to fulfill the purposes set forth in this Privacy Statement, unless a longer retention period is required or permitted by law. We will de-identify, aggregate, or otherwise anonymize your personal information if we intend to use it for analytical purposes or trend analysis over longer periods of time.</em></p>\r\n\r\n<p><em>The criteria we use to determine our retention periods include:</em></p>\r\n\r\n<ul>\r\n	<li><em>The duration of our relationship with you, including any open accounts you may have with Expedia Group companies, or recent bookings or other transactions you have made on our platform</em></li>\r\n	<li><em>Whether we have a legal obligation related to your personal information, such as laws requiring us to keep records of your transactions with us</em></li>\r\n	<li><em>Whether there are any relevant legal or tax-related obligations affecting how long we will keep your personal information, including contract and audit obligations, litigation holds, statutes of limitations, and regulatory investigations</em></li>\r\n</ul>\r\n\r\n<h2><em><strong>Cookie Statement</strong></em></h2>\r\n\r\n<p><em><strong>Types of cookies and similar technologies</strong></em></p>\r\n\r\n<p><em>Cookies</em></p>\r\n\r\n<p><em>Cookies are small pieces of text sent as files to your computer or mobile device when you visit most websites. Cookies may be delivered by us (first-party cookies) or delivered by a third-party partner or supplier (third-party cookies). Cookies are either session cookies or persistent cookies. Session cookies enable sites to recognize and link the actions of a user during a browsing session and expire at the end of each session. Persistent cookies help us recognize you as an existing user, and these cookies are stored on your system or device until they expire, although you can delete them before the expiration date.</em></p>\r\n\r\n<p><em>Other similar technologies</em></p>\r\n\r\n<p><em>&bull; <strong>Web beacons, gifs, and clear gifs</strong> are tiny graphics, each with a unique identifier, that are embedded invisibly on sites and in emails. Web beacons allow us to know if a certain page was visited or if ad banners on our sites and other sites are effective. We also use web beacons in our HTML-based emails to let us know whether our emails have been opened by recipients, which helps us to gauge the effectiveness of certain communications, promotions, and marketing campaigns.</em></p>\r\n\r\n<p><em>&bull; <strong>Proximity-based beacons</strong> send one-way signals over very short distances, to communicate with associated apps installed on your phone or mobile device. They can notify you, for example, about experiences related to your trip and can alert you to related deals or promotions. Beacons communicate with your device only when you are in close proximity and only if you have given consent within the relevant mobile application.</em></p>\r\n\r\n<p><em>&bull; <strong>Pixels </strong>are small objects embedded into a web page that are not visible to the user. We use pixels to deliver cookies to your computer, facilitate the log-in process, monitor the activity on our sites, and deliver online advertising.</em></p>\r\n\r\n<p><em>&bull; <strong>Tags </strong>are small pieces of HTML code that tell your browser to request certain content generated by an ad server. We use tags to show you relevant advertising and promotions.</em></p>\r\n\r\n<p><em>&bull; <strong>Scripts </strong>are pieces of JavaScript code that launch automatically when certain webpages load, to determine whether users view associated advertisements.</em></p>\r\n\r\n<p><em>&bull; <strong>Local Storage Objects</strong>, such as HTML 5, are used to store content and preferences. Third parties with whom we partner to provide certain features on our site to display advertising based upon your web browsing activity use Local Storage Objects to collect and store information.</em></p>\r\n\r\n<p><em>All of the technologies described above will be collectively referred to in this Cookie Statement as &ldquo;cookies.&rdquo;</em></p>\r\n\r\n<p><em><strong>Expedia Group&rsquo;s use of cookies</strong></em></p>\r\n\r\n<p><em>At Expedia Group, we use cookies for a number of reasons, including to:</em></p>\r\n\r\n<ul>\r\n	<li><em>Help us improve your experience when visiting our sites</em></li>\r\n	<li><em>Fulfill transactions and ensure our sites perform as intended</em></li>\r\n	<li><em>Remember your preferences, such as language, region, or currency</em></li>\r\n	<li><em>Provide you with relevant advertising and analyze performance of the ads</em></li>\r\n	<li><em>Enable you to return to previous travel searches</em></li>\r\n	<li><em>Identify errors on our sites</em></li>\r\n	<li><em>Help with data protection and potentially detect and investigate malicious or fraudulent activity</em></li>\r\n	<li><em>Help us understand traffic to our site, including time and date of the visit, time and date of the last visit, and other information</em></li>\r\n	<li><em>Analyze how well our sites are performing</em></li>\r\n</ul>\r\n\r\n<p><em><strong>Types of information collected by cookies</strong></em></p>\r\n\r\n<p><em>The types of information that we collect through cookies include:</em></p>\r\n\r\n<ul>\r\n	<li><em>IP address</em></li>\r\n	<li><em>Device ID</em></li>\r\n	<li><em>Viewed pages</em></li>\r\n	<li><em>Browser type</em></li>\r\n	<li><em>Browsing information</em></li>\r\n	<li><em>Operating system</em></li>\r\n	<li><em>Internet Service Provider</em></li>\r\n	<li><em>Whether you have responded to, or interacted with, an advertisement</em></li>\r\n	<li><em>Referring or referred links or URLs</em></li>\r\n	<li><em>Features used and activities engaged in on our sites and in our apps</em></li>\r\n</ul>\r\n\r\n<p><em>See the Categories of Personal Information We Collect section above for more information on what types of information are collected automatically.</em></p>\r\n\r\n<p><em><strong>Types and functions of cookies</strong></em></p>\r\n\r\n<p><em>Essential Cookies</em></p>\r\n\r\n<p><em>Certain cookies are required or &ldquo;essential&rdquo; for our sites to function as intended. Essential cookies are necessary for you to navigate our site and use certain features like logging in to your account and managing your bookings. These cookies are also used to remember security settings that allow access to particular content. Lastly, we use essential cookies to collect information on which web pages visitors go to most, so we can improve our online services. You are not able to opt out of essential cookies.</em></p>\r\n\r\n<p><em>Other Types of Cookies</em></p>\r\n\r\n<p><em>We also use other types of cookies to make our site engaging and useful to you:</em></p>\r\n\r\n<p><em>&bull; <strong>Functional Cookies</strong>. We want to make sure that when you visit our site, your preferences (such as your preferred language), settings, and previous searches are remembered. Functional cookies enhance your experience on any Expedia Group company&rsquo;s site.</em></p>\r\n\r\n<p><em>&bull; <strong>Analytics Cookies</strong>. We use analytics cookies to:</em></p>\r\n\r\n<p><em>Understand our site&rsquo;s performance and how it is used, including the number of visitors, how long you stay on the site, and which parts of the site you visit. We can see details about how visitors have interacted with the site, such as the number of clicks made on a given page, mouse movements and scrolling activity, search words used, and the text entered into various fields</em></p>\r\n\r\n<p><em>Test different designs and features for our site</em></p>\r\n\r\n<p><em>Monitor how our visitors reach our sites</em></p>\r\n\r\n<p><em>Determine effectiveness of our advertising</em></p>\r\n\r\n<p><em>Improve our services, including your experience on our site</em></p>\r\n\r\n<p><em>For analytics, our third-party service providers may use cookies to perform their services and may combine the information that they collect about you on our sites with information they have collected elsewhere. For example, we use Google Analytics cookies to monitor the performance of our sites. Our ability to use and share information collected by Google Analytics about your visit to our sites is restricted by the Google Analytics Terms of Use and the Google Privacy Policy. This Cookie Statement does not cover such third parties&rsquo; use of your information.</em></p>\r\n\r\n<p><em>Some analytics cookies can perform tasks essential or functional to online services, such as enabling site improvements and testing changes to a site.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em><strong>How can you manage your cookies?</strong></em></p>\r\n\r\n<p><em>You can set or amend your web browser controls to accept or refuse cookies whenever you like, but please remember if you do choose to reject cookies, your access to some of the functionality and areas of our site may be restricted.</em></p>\r\n\r\n<p><em><strong>Do-Not-Track Signals and Similar Mechanisms.</strong></em></p>\r\n\r\n<p><em>Some web browsers may transmit &ldquo;do not track&ldquo; signals to sites with which the browser communicates. Because of differences in how web browsers incorporate and activate this feature, it is not always clear whether users intend for these signals to be transmitted, or whether users are even aware of them. Participants in the leading Internet-standards-setting organization that is </em></p>\r\n\r\n<p><em>We may update this Privacy Statement in response to changing laws or technical or business developments. You can see when this Privacy Statement was last updated by checking the &ldquo;last updated&rdquo; date displayed at the top of this Statement.</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'second', 'Active', 0, 0, 0, NULL, '2021-07-20 12:34:56');
INSERT INTO `pages` (`id`, `name`, `url`, `content`, `position`, `status`, `faq`, `subpage`, `sortby`, `created_at`, `updated_at`) VALUES
(5, 'Terms and Conditions', 'terms-and-conditions', '<p>&nbsp;<strong>Terms and Conditions</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>By reading our terms and conditions you hereby agree to be bound by these terms and conditions of our Privacy Policy. If you do not agree to all of these Terms, then you may not use Our Website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please review these Terms periodically for changes as we may modify these Terms for any reason at any time without notice by posting a new version on Our Website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. We are an internet portal for short term site users we &nbsp;Do Not Sell Travel Products or Properties</strong></p>\r\n\r\n<p>Our Website is a travel search engine only and a portal to bring together hosts and guests to share information about properties and guests to the extend whereby they might go forth and share accommodation for or not for a renumeration that will be decided on by the parties and which has nothing to do with our site. BNB does not provide, own or control any of the properties. The Travel Products are owned and controlled by third parties. We have no control over the Properties, and we do not verify the content uploaded by the Owners, it is not possible for us to guarantee the prices or properties displayed on Our Website.</p>\r\n\r\n<p><strong>2. Booking through BNB</strong></p>\r\n\r\n<p>If you make a booking through Our Website, that booking is made with the Host and Our Website only acts as a user interface. Accordingly, BNB has no responsibility for the booking or the Property. If you have any issues or disputes with your booking, you agree to address and resolve these with the Host and not with us.</p>\r\n\r\n<p><strong>3. Use of Our Website</strong></p>\r\n\r\n<p>You must be of legal age to enter into a binding contract. You are responsible for your passwords, login and account information. Your information must be accurate. Report any information changes immediately. Contact us if you think your information has been stolen.</p>\r\n\r\n<p>Do not use Our Website to make any false, fraudulent or speculative reservation or any reservation in anticipation of demand. By using Our Website, you agree to comply with laws that apply to Canada and your own country.</p>\r\n\r\n<p>We may, at any time and without advance notice or liability, suspend, terminate or restrict your access to Our Website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4.&nbsp; Do Not Impersonate any person or misrepresent.</strong></p>\r\n\r\n<ul style="list-style-type:disc">\r\n	<li>Intentionally or unintentionally violate or encourage others to violate any applicable law or regulation.</li>\r\n	<li>Provide false or deceptive information.</li>\r\n	<li>Solicit personal information from anyone.</li>\r\n	<li>Publish or post threats of violence, discrimination or promote or encourage others to engage in violence or illegal activity.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5.&nbsp;</strong><strong>Our Liability Is Limited</strong></p>\r\n\r\n<p>We hereby exclude any responsibility and liability for any loss or damages to, or viruses that may infect, your computer equipment or other property as the result of your access to Our Website, your downloading of any content from Our Website or any injury; death; loss; claim; act of god; accident; delay; or any direct, special, exemplary, punitive, indirect, incidental or consequential damages of any kind in regard to your stay.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6.&nbsp;</strong><strong>You Agree to Protect Us</strong></p>\r\n\r\n<p>Subject to these Terms, you will defend, indemnify, and hold us harmless from and against any claim, cause of action, liability, expense or loss incurred by you.&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7.&nbsp;</strong><strong>Links</strong>&nbsp;Our Website may contain links to other websites for which we are not responsible. We provide these links for your reference and convenience and do not the contents of Other Websites and accept no responsibility for them or for any loss or damages that may arise from your use of them.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>8.&nbsp;</strong><strong>Unauthorized Uses of the Site.&nbsp;</strong></p>\r\n\r\n<p>You agree not to do any of the following.&nbsp; If you are aware of, or experience, any abuse to our Terms, we ask that you please inform us by contacting us Contact Us</p>\r\n\r\n<p>&middot;&nbsp;Use the Site to post or transmit information that is in any way false, fraudulent, or misleading, including making any reservation or inquiry under false pretenses, or taking any action that may be considered phishing or that would give rise to criminal or civil liability;</p>\r\n\r\n<p>&middot;&nbsp;Post or transmit any unlawful, threatening, abusive, libelous, defamatory, obscene, vulgar, indecent, inflammatory, sexually explicit, pornographic or profane material;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>9.&nbsp;</strong><strong>General Requirements</strong></p>\r\n\r\n<p>We may change the site and these Terms at any time, in our sole discretion and without notice to you. You are responsible for updating yourself with these Terms. Your continued use of the site constitutes your acceptance of any changes to these Terms and any changes will supersede all previous versions of the Terms.</p>\r\n\r\n<p>To the extent permitted by law, you agree that any disputes, claims and causes of action arising out of or connected with Our Website and/or these Terms, will be resolved individually, without resort to any form of class action.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>10.&nbsp;</strong><strong>Our Privacy Policy;</strong></p>\r\n\r\n<p>When you provide your e-mail address, name or other contact information in connection with your use or access to the Site, you agree to allow the Site and its affiliated websites to add your e-mail address, name or other information provided to our database of users. You may receive one or more promotional e-mails from either the Site or a website. You are welcome to opt not to receive such promotional e-mails from the Site or such affiliates&rsquo; websites at any time. Please review our Privacy Policy for more information regarding our email and other data collection practices and safeguards, and how to opt not to receive such emails.</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>11.&nbsp;</strong><strong>Identity Verification.</strong></p>\r\n\r\n<p>User verification on the Internet is nearly impossible to police. As such we cannot &nbsp;assume any responsibility for each user&#39;s purported identity. We encourage you to communicate directly with a guest or host through the tools available on the Site, though even this does not assure you of the identity of the person with which you are communicating. We further encourage you to take other reasonable measures to assure yourself of the other person&rsquo;s identity and, for travelers, of the property and relevant details of your booking by verifying ID upon arrival.</p>\r\n\r\n<p>Keep your password and online ID for both your account with us and your email account secure and strictly confidential, notify us immediately and select a new online ID and password if you believe your password for either your account with us or your email account may have become unsecure.&nbsp;</p>\r\n\r\n<p>We discourage you from giving anyone access to your online ID and password for your account with us and your email account.</p>\r\n\r\n<p>We may, without notice to you, suspend or cancel your listing at any time even without receiving notice from you if we suspect that your account with us or your email account is being used in an unauthorized or fraudulent manner.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>12.&nbsp;</strong><strong>Responsibility for Property Listings, Reviews.</strong></p>\r\n\r\n<p>We have no duty to pre-screen content posted on the Site by users, or a third party on behalf of the user.</p>\r\n\r\n<p>We reserve the right to decline the posting on the Site of or to remove from the Site any content fails to meet our standards.&nbsp;</p>\r\n\r\n<p>All property listings on the Site are the sole responsibility of the host (who may be the owner or a property manager or duly authorized agent of the owner) and we specifically disclaim any and all liability arising from the alleged accuracy of said listings or reviews. Hosts are solely responsible for keeping their property information up-to-date on the Site, including, but not limited to, any and all representations about any property, its amenities, location, price and its availability for a specific date or range of dates. We do not represent or warrant that any of the copy, content, or property reviews, guest entries, property location, pricing or availability information published on the Site is accurate or up-to-date even in the case where guests have searched for specific dates or types of properties.&nbsp;Guests and hosts are responsible for properly representing themselves and the properties to the best of their knowledge and in good faith.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;By submitting listing, you grant to us the ability to market and promote said property subject to the content that you have created.&nbsp; You also allow us to use our affiliates BNB other cities to do same.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>13.&nbsp; Social Media or Third-Party Websites.</strong></p>\r\n\r\n<p>If the Site offers a tool or service that allows us to access or use any profile or other information about you that you have provided to Facebook or another third-party website and you decide to use such tool or service, you acknowledge and agree that:</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;The information or content is correct and that is a part of your Social Media profile, which you have designated as public use</p>\r\n\r\n<p>&middot;&nbsp;The Social Media Content will shall have the same rights and responsibilities as you;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>14.&nbsp;&nbsp;</strong><strong>Translations and Maps.</strong></p>\r\n\r\n<p>We cannot guarantee the accuracy or quality and the user is solely responsible for the review, verification and accuracy. Maps provided on the Site that are provided by Google are subject to the Google Maps</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>15.&nbsp;</strong><strong>Links to Third-Party Sites.</strong></p>\r\n\r\n<p>This Site may contain links and pointers to other Internet sites which are not endorsed by us. We may also provide tools to allow interaction between the Site and a third-party site, such as a Social Media Site. We are not responsible in any way for such third-party sites.&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>16.&nbsp;</strong><strong>Disclaimers.&nbsp;&nbsp;</strong></p>\r\n\r\n<p>The site, is &ldquo;As Is.&rdquo;&nbsp; We make no representations or warranties for the content on the site. We are not responsible for any defects or that it will in the future be free of any virus or harmful component.</p>\r\n\r\n<p>You acknowledge and agree that you will not hold or seek remedy for the content and that we are not a party to any rental transaction.&nbsp; We have no control over nor can we access the safety of any transaction or rental property stay.&nbsp; &nbsp;We rely on the integrity and honesty and transparency of our users when interacting amongst themselves.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>&nbsp;17.&nbsp;</strong><strong>Responsibility for Property and Traveler Liability.</strong></p>\r\n\r\n<p>Users are solely responsible for obtaining insurance coverage sufficient to protect their properties and guests or their trip, as applicable. Members agree that they have or will obtain the appropriate insurance coverage sufficient to cover the rental of the properties they list on the Site. Further, members agree to provide us with copies of relevant proof of coverage upon request.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>18.&nbsp;</strong><strong>GENERAL</strong></p>\r\n\r\n<p>Contact Us for any reason,</p>\r\n\r\n<p>We may change, suspend or discontinue any aspect of the Site at any time. We may also impose limits on certain features or services or restrict your access to parts or the entire Site without notice or liability.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>19.&nbsp;</strong><strong>Member Eligibility; Accuracy of Information; Listing Requirements.</strong></p>\r\n\r\n<p>&nbsp;Our services may only be used by users who can form legally binding contracts under applicable law. Each user agrees that all information submitted to us shall be true and correct and provide notice regarding any updates.</p>\r\n\r\n<p>In order to list a property on a Site, members must comply with BNB&rsquo;s Standards. Members must maintain an accurate reservation calendar on their listing(s);</p>\r\n\r\n<p>&middot;&nbsp;Members must use reasonable efforts to respond to all booking requests from travelers within 24 hours of receipt of a request for booking.</p>\r\n\r\n<p>&middot;&nbsp;Members must respond to and accept booking requests received in the interest of the traveler experience.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;</p>\r\n\r\n<p><strong>20.&nbsp;</strong><strong>Additional Member Representations.</strong>&nbsp;</p>\r\n\r\n<p>Each member represents that they own and/or has all necessary rights and authority to offer for rent and to rent the property</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;will not wrongfully withhold a rental deposit in breach of the underlying rental agreement and &nbsp;</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;will accurately describe the subject rental property,</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;will not fail to disclose a material defect in, or material information about, a rental property and will upon request, or otherwise from time to time, review the property listing content and location or geographic description to ensure it is accurate and not misleading &nbsp;</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;will not wrongfully deny access to the listed property</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;will not fail to provide a refund when due in accordance with the applicable cancellation policy or underlying rental agreement.</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Upon our request, each member agrees to promptly provide to us such proof of personal identification, proof that the condition, location, or amenities associated with the property are accurately described in the listing, proof of ownership of the property listed on the Site, and/or proof of authority to list the property. If you are a tenant who is listing a home, condominium, or apartment, please refer to your rental contract or lease, or contact your landlord, prior to listing the property to determine whether your lease or contract contains restrictions that would limit your ability to list your room, home, condominium or apartment. Listing your home may be a violation of your lease or contract and could result in legal action against you by your landlord, including possible eviction.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;21.&nbsp;</strong><strong>Appearance in Search Results.&nbsp;</strong></p>\r\n\r\n<p>We cannot guarantee that your listing will appear in any specific order in search results on the Site. Search order will fluctuate based on a variety of factors such as search parameters, guests&rsquo; preferences and algorithms that prioritize the properties based on the response and reviews of the online guests.&nbsp; &nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>22.&nbsp;</strong><strong>Content, Layout and Copy.&nbsp;</strong></p>\r\n\r\n<p>All content and copy edits submitted by members are subject to review and approval by us in our sole discretion. We reserve the right to refuse to publish any content that we determine in our sole discretion does not meet these Terms or is otherwise unacceptable to us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>23. Photographs.</strong></p>\r\n\r\n<p>Photographs should depict the vacation rental as the main subject of the photograph and may not include children or adults if you do not have their legal consent or any information or images that would violate the privacy rights.&nbsp; We reserve the right to not display or to remove any photographs that we determine, do not meet these Terms or are otherwise unacceptable to us.</p>\r\n\r\n<p>By submitting a photograph to us, the member represents and warrants that</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;it holds all intellectual property rights</p>\r\n\r\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;that any people in the photograph have given permission for their likeness to be displayed in an online advertisement on the Site</p>\r\n\r\n<p>that the photograph accurately and fairly represents the subject of the photograph and has not been altered in any manner that would mislead a viewer of that photograph</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>24.&nbsp;&nbsp;</strong><strong>Substitution of Properties; Advertising More Than One Property; Property Managers.</strong></p>\r\n\r\n<p>&nbsp;Each listing must relate to an individual identified property. This means that:&nbsp;The property in a listing may not be substituted for another property without our consent. The listing cannot be a mere example of properties in a given area.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>25. Payment Method Requirements; Bank and Credit Card Fees.</strong></p>\r\n\r\n<p>No user may request any traveler to mail cash, or utilize any instant-cash wire transfer service such as Western Union or MoneyGram in payment for all or part of a property rental transaction. Any violation of this term or any other unacceptable payment methods that may be posted on the Site may result in the immediate removal of the non-conforming listing from the Site without notice to the member and without refund.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>.</p>\r\n\r\n<p><strong>26.&nbsp; Subscription Term and Refund Requests.</strong>&nbsp;</p>\r\n\r\n<p>Generally, no refunds are available unless a member qualifies for a refund under any special program we may have in effect. If you believe you qualify for a refund, you may contact host directly. &nbsp;If you sell your property and no longer wish for the listing to remain online, please contact us and we can remove the listing; however, no refund will be owed.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>28.&nbsp;Termination of Listings; Other Remedies.</strong></p>\r\n\r\n<p>&nbsp;If, in our sole discretion, any user submits unsuitable material to our Site or into our database, is not abiding by local rental regulations and is creating a nuisance in its community, misuses the Site or our online system or is in material breach of these Terms, we reserve the right to limit the member&rsquo;s use and or terminate.&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>29.&nbsp;&nbsp;</strong>Our currency conversion should not be relied upon as accurate or real-time; actual rates may vary, and your payment provider (e.g., your credit card company) may charge conversion fees and apply another date&rsquo;s currency rate.</p>', 'first', 'Active', 0, 0, 0, '2021-07-26 09:18:36', '2021-09-07 09:37:34'),
