(1, 1, 'Located in Times Square, this Manhattan hotel is within 7 minutes’ walk of Rockefeller Center and Radio City Music Hall. Guests can enjoy the convenience of a concierge service and on-site dining.\r\nServing traditional American cuisine with views of Times Square, the Brasserie 1605 prepares breakfast, lunch and dinner. Guests at the Times Square Crowne Plaza can also have drinks at the Broadway 49 Bar.', 'The Central Park Zoo features more than 100 species of animals from the tropics, polar regions, and the California Coast. An equatorial rain forest houses monkeys and free-flying birds while penguins inhabit the Arctic section. Other animal highlights include polar bears, snow leopards, and red pandas. Near the entrance is the charming Delacorte Clock, where bronze musical animals encircle the time piece and play nursery chimes every half-hour.', 'A walk, peddle, or carriage ride through the crisscrossing pathways of Central Park is a must-do on anyone''s New York City itinerary. In winter, you can even lace up your skates and glide across Wollman Rink. This huge park in the city center, a half-mile wide and 2.5 miles long, is one of the things that makes New York such a beautiful and livable city. Besides being a great place to experience a little nature, Central Park has many attractions within its borders, including the Belvedere Castle, Strawberry Fields, the Central Park Zoo, and the Lake', NULL, NULL, NULL, 'Located within Central Park, Strawberry Fields is a memorial for John Lennon, who was tragically murdered in front of the Dakota apartments just off the west side of the park. A mosaic is set in the pathway with the word "Imagine" inscribed, named after Lennon''s 1971 song. The landscape was designed by Vaux and Olmstead and features 161 species of plants (one from every country in the world).', NULL, NULL, NULL, NULL, NULL),
(2, 2, 'At the crossroads of Tribeca and the Financial District, just a block from the World Trade Center, Four Seasons Hotel New York Downtown adds its classic architectural profile to the world’s most famous skyline. Discover a New York luxury hotel with Downtown’s creativity and confidence, surrounded by the non-stop, dynamic scenes of the new New York.', 'On a tour to the Statue of Liberty, you have the option to stop at Ellis Island and explore the Immigration Museum. This fantastic museum is located in the historic immigration station complex, where thousands of immigrants were processed before entering the United States. Displays focus on the process, the experiences, and the stories of the people who came through here on their journey to the United States. You can even search the on-site computer database to see a record of immigrants who came through here.', 'The Statue of Liberty was France''s gift to America. Built in 1886, it remains a famous world symbol of freedom and one of the greatest American icons. It is one of the world''s largest statues, standing just under 152 feet tall from the base to the torch, and weighing approximately 450,000 pounds.\r\nYou can see the statue from land, with particularly good views from Battery Park, on the southern tip of Manhattan. However, to truly appreciate the Statue of Liberty, it''s best to take a short boat trip to Liberty Island and see it up close. You can walk around the base, enter the pedestal, or, with advance reservations, go right up to the crown.', NULL, 'Tickets to go inside the statue sell out. Pre-purchasing tickets is a must during the high season and a good idea at any time of year. The Statue of Liberty and Ellis Island Guided Tour is a three-hour trip that takes you to both the Statue of Liberty and Ellis Island. Note: Buying tickets at the ferry can be tricky, with hawkers claiming to be "official representatives" trying to sell you more expensive tickets before you can find the ticket booth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 'It may be hard to believe, but when it officially opens today, the Park Hyatt New York will be the first five-star hotel to debut in Gotham in over a decade. Indeed, ever since the opening of the nearby Mandarin-Oriental in 2003, New York has been awash in small-scale, chic-boutiques rather than pricey, full-service grand-dames. But as it opens today, the Park Hyatt intends to return the City’s hotel culture back to its high-glamour— and high-priced — roots.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 'Set in the trendy Oberkampf quarter, this hip, no-frills hotel is a 5-minute walk from Ménilmontant metro station, 9 minutes from the Parc de Belleville, and 1.6 km from Père Lachaise Cemetery.\r\n\r\nThe bright, casual rooms are accessed by stairs only, and feature free Wi-Fi and flat-screen TVs, as well as minibars, and tea and coffeemaking equipment. Family rooms add extra beds.\r\n\r\nContinental breakfast is free. There are coin-operated laundry facilities available for a surcharge.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 'The City of Light meets the city of sin at Paris Las Vegas. The centrally-located Parisian-themed hotel boasts a replica Eiffel Tower, a mock Arc de Triomphe and French restaurants mixed with a Las Vegas-style nightclub and shows.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 6, 'Offering luxury guest rooms, the lovely Boutique Hotel Wellenberg lies within a 5-minute walk from Town Hall . Residing in a 5-story historical building, the hotel was renovated in 2009.The property is about 550 meters away from Paradeplatz. Nestled in the museum district and 1 km from the city center.\r\n\r\nA shopping street and boutiques are also set close by.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 7, 'Elegant and authentic, Beau-Rivage is an exceptional house, with its incredible view on the iconic Jet d''Eau, the lake, the Mont-Blanc, the snowy summits and the city. Through its history, contribute to extend the list of extraordinary personalities who have stayed at Beau-Rivage.\r\n\r\nWith its humanity and attention to detail, together we will make your stay unique.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 8, 'Located on Paral·lel Avenue, where long tradition theaters come together with the trendiest restaurants in the city, Hotel Barcelona Universal is just 5 minutes away from Barcelona''s emblematic promenade that connects Plaza Catalunya to the port.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 9, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 10, 'Hotel details\r\nIn Bangkok''s vibrant Pratunam area, this upscale contemporary hotel is 9 minutes from the CentralWorld shopping mall, and 6 km from Wat Phra Kaew temple. \r\n\r\nFeaturing city, garden or pool views, the warm rooms come with free Wi-Fi, flat-screen TVs and DVD players, as well as tea and coffeemakers, minifridges and safes. Suites add whirlpool tubs. Club rooms have access to a private lounge offering free breakfast and cocktails.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 11, 'Discover a destination at once bohemian, sophisticated and inspiring. SIXTY SoHo hotel mirrors its stylish surroundings, standing as an inimitable hotel in one of New York City’s most vibrant neighborhoods. Stay in big city style, relax in newly renovated guestrooms and suites, and imbibe at stunning spaces at this upscale SoHo hotel.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 12, 'Located in Chelsea, Hotel Pennsylvania is within a 5-minute walk of  Penn Station and within 15 minutes of other popular attractions like Macy''s. This 1705-room hotel has a restaurant along with conveniences like a fitness center and a 24-hour business center. Centrally located in New York, the hotel is also a short walk from Empire State Building and Times Square', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 13, 'In Bangkok''s vibrant Pratunam area, this upscale contemporary hotel is 9 minutes from the CentralWorld shopping mall, and 6 km from Wat Phra Kaew temple. \r\n\r\nFeaturing city, garden or pool views, the warm rooms come with free Wi-Fi, flat-screen TVs and DVD players, as well as tea and coffeemakers, minifridges and safes. Suites add whirlpool tubs. Club rooms have access to a private lounge offering free breakfast and cocktails.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 14, 'Set amid the pubs and craft shops of The Rocks district, this industrial-chic hotel in a redbrick 1887 building, is a 5-minute walk from Circular Quay train station and a 15-minute walk from both Sydney Opera House and Sydney Harbour Bridge.\r\n\r\nFeaturing bold fabrics, the chic rooms and suites have free Wi-Fi, flat-screens, minibars, room service, and tea and coffeemakers. Upgraded rooms add iPod docks, sitting areas and/or sofabeds, while some suites offer harbour views.', NULL, 'The Sydney Opera House, a world-class performing arts venue and iconic Australian landmark, defines the Sydney Harbour in the heart of the city. Designed by Danish architect Jorn Utzon, the structure is a masterpiece of late 20th-century architecture, despite challenges that plagued the 15-year project before it was formally opened by Queen Elizabeth II in 1973. Distinguished by soaring halls with a white ceramic-tiled exterior shaped to evoke the sails of a yacht, this UNESCO World Heritage Site is a must-see Sydney attraction.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15, 15, 'Set in the Central Business District, this sophisticated hotel is a 5-minute walk from Wynyard train station and 1.5 km from the Sydney Opera House. \r\n\r\nThe warm polished apartments feature paid Wi-Fi, flat-screen TVs, and minibars. All also offer kitchens, washer/dryers and room service, and some have balconies. Upgraded apartments add sofabeds, and there''s also a 3-bedroom penthouse apartment with a whirlpool bath and a terrace.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(16, 16, 'This bright and modern hotel, set in the Central Business District, is across the street from Hyde Park and a 7-minute walk from Town Hall railway station. It’s also 2.4 km from the Sydney Opera House.\r\n\r\nThe colourful rooms feature free Wi-Fi, flat-screen TVs with DVD players, and tea and coffeemaking equipment. Upgraded rooms add microwaves, minifridges, wet bars and sitting areas; some add private balconies and park views. The 2-bedroom apartments feature full kitchens.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(17, 17, 'Set in the 22@ business district, this modern hotel is a 5-minute walk from the Llacuna metro station and 1.9 km from Mar Bella beach. \r\n\r\nColorful rooms come with complimentary Wi-Fi, flat-screen TVs, and coffeemakers. Upgraded rooms add pull-out sofas. Kids 18 and under stay free with a parent.\r\n\r\nBreakfast is served in a contemporary dining room for a fee. There''s also a bar, a business center and a meeting room.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
