(37, 37, 'Outstanding Downtown place with a lot of space for families or groups. 3 comfy beds and 2 full washrooms. Steps to TTC , Rogers Centre, CN Tower and Entertainment District.\r\n\r\nThe space\r\nWasher and dryer inside the unit.', NULL, NULL, 'THE UNIT WILL BE PRIVATE, ONLY FOR YOU AND YOUR GUESTS.', NULL, 'PLEASE NOTE FOR LATE CHECK INS:\r\n-FOR LATE CHECK INS, after 10pm, there''s an extra fee of $20 paid upon check in.\r\n-FOR LATE CHECK INS, after midnight, there''s an extra fee of $30 paid upon check in.\r\n\r\n*Standard Check-in: 5 pm\r\n-Early check in which requires 50 % of the daily rate: 9 am onwards\r\n-Early check in which is considered full day rate: before 9 am\r\n\r\n*Standard Check-out: 12 pm\r\n-Late check-out which requires 50 % of the daily rate: 1 pm onwards\r\n-Late check-out which is considered full day rate: after 4 pm\r\n\r\nID copy must be provided upon check in.\r\n\r\nThere is a new by-law in Toronto restricting noise after 11pm. Security and Authorities have a zero tolerance level when it comes to guests abusing the rights of residents in the neighbourhood. They will fine and or evict upon their discretion. Failure to abide by this city wide agreed by law could result in loss of your security deposit and even further damages. Please respect my home and the residents of CityPlace at all times as you are my guest.\r\n\r\nLicense number\r\nSTR-2101-FSXXVC', 'There are quite a few restaurants to choose from around. Some good places to grab a bite are The Morning After, Hunters Landing and Fort York Tavern. Venture a little further for a meal at Sansotei Ramen, The Arepa Republic or Iruka Sushi. If you love coffee, you''re not too far from Tim Hortons and Starbucks. Groceries can be found at Sobeys which is a 3-minute walk and you''ll find Bloom Pharmacy a short distance away as well. Interested in the arts?\r\n\r\nLook no further than Victoria Memorial Squar', NULL, NULL, '509', 'There are quite a few restaurants to choose from around. Some good places to grab a bite are The Morning After, Hunters Landing and Fort York Tavern. Venture a little further for a meal at Sansotei Ramen, The Arepa Republic or Iruka Sushi. If you love coffee, you''re not too far from Tim Hortons and Starbucks. Groceries can be found at Sobeys which is a 3-minute walk and you''ll find Bloom Pharmacy a short distance away as well. Interested in the arts?\r\n\r\nLook no further than Victoria Memorial Squar', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
