(39, 39, '2,738 SQ.FT of Luxury, towering over buildings with City & Lake Views.\r\nGreat For LARGE FAMILIES or groups. PLEASE BE AWARE THAT IT IS NOT ALLOWED TO WEAR SHOES (BOOTS, HIGH-HEELS,ETC.) INSIDE OF THE HOUSE, ONLY SLIPPERS.\r\nSleeps 12 Comfortably but there are an additional 5 Leather Couches if required.\r\n**No parties o extra visitors allowed** No loud noise.Zero tolerance to noisy guests and will result in the removal of your booking without refund.', NULL, NULL, NULL, NULL, NULL, 'CityPlace is the largest urban development in Toronto''s History. It is completely surrounded with entertainment and restaurants and all of your essentials that you may require. An 8 Acre Park view along with Lake Ontario gives you a terrific exposure to the development. Come find out why CityPlace is the number one selling condominium development.', NULL, NULL, 'PH6', 'CityPlace is the largest urban development in Toronto''s History. It is completely surrounded with entertainment and restaurants and all of your essentials that you may require. An 8 Acre Park view along with Lake Ontario gives you a terrific exposure to the development. Come find out why CityPlace is the number one selling condominium development.', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
(40, 40, 'Enjoy this great location in style with all of the luxurious furnishings. Great location great building.\r\n\r\nThe suite offers the scale and atmosphere of a boutique hotel with the added benefit of newly high end furnishings. Along with the full kitchen and bathroom and office, you will feel at home. I pride myself in offering my guests the best.', NULL, NULL, NULL, NULL, NULL, 'Walking distance to nearly everything. Medical and dental facilities dry cleaning and video, school for the first 8 grades, Sobey''s Supermarket, Tim Horton''s and Starbucks and right across from an 8 acre park with a one mile jogging trail dedicated to Terry Fox.', NULL, NULL, '650', 'Walking distance to nearly everything. Medical and dental facilities dry cleaning and video, school for the first 8 grades, Sobey''s Supermarket, Tim Horton''s and Starbucks and right across from an 8 acre park with a one mile jogging trail dedicated to Terry Fox.', 'Wifi network name: suite#\r\nWifi password: 4167127908'),
(41, 41, 'PLEASE NOTE recently painted and furnished, RESPONSIBLE CLEAN GUESTS ONLY. Enjoy this fantastic location. It''s a really spacious suite with 2 BEDS 1 Luxury King and the other Double with office built in. It''s located in the heart of City Place and close to a grocery store and great restaurants. One underground parking spot included.', NULL, NULL, NULL, NULL, NULL, 'CityPlace is the largest urban development in Toronto''s History. It is completely surrounded with entertainment and restaurants and all of your essentials that you may require. An 8 Acre Park view along with Lake Ontario gives you a terrific exposure to the development. Come find out why CityPlace is the number one selling condominium development.', NULL, NULL, '232', 'CityPlace is the largest urban development in Toronto''s History. It is completely surrounded with entertainment and restaurants and all of your essentials that you may require. An 8 Acre Park view along with Lake Ontario gives you a terrific exposure to the development. Come find out why CityPlace is the number one selling condominium development.', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
(42, 42, 'This Light Filled 1 Bedroom + Den condo, with a comfy 1 King bed + King Sofa Bed. The comfort of downtown living with the essentials of home. Immerse yourself in the luxury of this modern design, clean and fresh with all the essentials . Good for couples, solo adventurers, business travelers & families (with kids). Please bring valid ID, we only issue the keys to the guest booking.', NULL, NULL, NULL, NULL, NULL, 'Access to TTC, Gardner Expressway is steps from your door. A walk away and you are enjoying everything Toronto offers, from its vibrant night life to various parks and trials along the waterfront.', NULL, NULL, '850', 'Access to TTC, Gardner Expressway is steps from your door. A walk away and you are enjoying everything Toronto offers, from its vibrant night life to various parks and trials along the waterfront.', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
(43, 43, 'Beautiful 1 King bed & 1 Bunk bed (2 single beds). The comfort of downtown living with the essentials of home. A condo fresh with all the essentials . Enjoy this suite for a fraction of the cost of a hotel. You’ll love my place because of the comfy bed, the kitchen and the cosiness. Please bring valid ID, we only issue the keys to the guest booking.', NULL, NULL, NULL, NULL, NULL, 'CityPlace is a neighbourhood in Downtown Toronto, Ontario, Canada, within the former Railway Lands. When completed, this area will be the largest residential development ever created in Toronto. The area is bordered by Bathurst Street to the west, Lake Shore Boulevard to the south, and Front Street to the north and Blue Jays Way and the Rogers Centre to the east. Cityplace is also a 5- to 10-minute walk from King Street West and Liberty Village and a 10- to 20-minute walk from Toronto''s financia', NULL, NULL, '250', 'CityPlace is a neighbourhood in Downtown Toronto, Ontario, Canada, within the former Railway Lands. When completed, this area will be the largest residential development ever created in Toronto. The area is bordered by Bathurst Street to the west, Lake Shore Boulevard to the south, and Front Street to the north and Blue Jays Way and the Rogers Centre to the east. Cityplace is also a 5- to 10-minute walk from King Street West and Liberty Village and a 10- to 20-minute walk from Toronto''s financia', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
