(48, 48, 'CORNER SUITE, Right across from Eaton Centre with view of Dundas Square. It''s a 2 bedroom and 2 washrooms condo. 1 Parking spot included underground after Sept 15th 2020. Please notice that this parking lot is an automated elevator and some of the guests had been experienced up to 2 hours to get their car out of the parking lot\r\nIMPORTANT: Key pick up location is different and is on route to the unit(15 minutes driving/ 2 Miles aprox.)', NULL, NULL, NULL, NULL, NULL, 'Located right on Yonge Street, Dundas Square is Toronto’s most densely populated neighborhood. It has the advantage of being located within walking distance of the Financial District, the Discovery District, the Hospital District, Toronto City Hall, Ryerson University, the University of Toronto and downtown Yonge Street.', NULL, NULL, '1802', 'Located right on Yonge Street, Dundas Square is Toronto’s most densely populated neighborhood. It has the advantage of being located within walking distance of the Financial District, the Discovery District, the Hospital District, Toronto City Hall, Ryerson University, the University of Toronto and downtown Yonge Street.', 'Wifi network name: Suite #\r\nWifi password: 4167127908'),
