(134, 134, '2 bedrooms, 2 bathrooms. Yonge & Gerrard, soaring South over Lake Ontario & East City Lights. Enjoy this Luxury suite.\r\nPlease bring valid ID, we only issue the keys to the guest booking.', NULL, NULL, 'Enjoy the comforts of home in a 2 bedroom luxury suite with skyline views south and east. For those who prefer to sit on the sidelines to enjoy their sport, the Rogers Center and Air Canada Center are just a short distance away. In need of some retail therapy? The boutiques along Queen West offer a plethora of styles to satisfy every fashion lover. And foodies will delight in many of Toronto''s best restaurants, bars, lounges and clubs in neighboring King West. Location offers a lifestyle of neighborhood amenities and downtown attractions, the perfect home for the urban dweller.', NULL, 'PLEASE NOTE FOR LATE CHECK INS:\r\n-After 10pm, there''s an extra fee of $20 paid upon check in.\r\n-After midnight, there''s an extra fee of $30 paid upon check in.\r\n\r\n*Standard Check-in: 4 pm\r\n-Early check in which requires 50 % of the daily rate: 11am onwards\r\n-Early check in which is considered full day rate: before 11am\r\n\r\n*Standard Check-out: 11 am\r\n-Late check-out which requires 50 % of the daily rate: 11am onwards\r\n-Late check-out which is considered full day rate: after 1pm\r\n\r\nID copy must be provided upon check in.\r\n\r\nThere is a new by-law in Toronto restricting noise after 11pm. Security and Authorities have a zero tolerance level when it comes to guests abusing the rights of residents in the neighbourhood. They will fine and or evict upon their discretion. Failure to abide by this city wide agreed by law could result in loss of your security deposit and even further damages. Please respect my home and the residents at all times as you are my guest.\r\n\r\n*Please note that the place has been listed for sale by the owner and during your stay we might need to do showings; we will give you a 24 Hour Notice. We are obliged to give access*', 'This apartment is located in Toronto, Ontario, Canada.\r\nLakeshore and York, walking distance to the waterfront, or to any of the highly recognized attractions of Toronto. Direct access to the Path. Right across from the Air Canada Centre.', NULL, NULL, '4509', 'This apartment is located in Toronto, Ontario, Canada.\r\nLakeshore and York, walking distance to the waterfront, or to any of the highly recognized attractions of Toronto. Direct access to the Path. Right across from the Air Canada Centre.', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
(135, 135, 'Views of the City and park. Immerse yourself in the luxury of this modern design, clean and fresh with all the essentials . Enjoy this stunning suite for a fraction of the cost of a hotel. My place is close to Harbourfront Centre, Amsterdam BrewHouse, Williams Landing, and Tim Hortons.s. My place is good for couples, solo adventurers, business travellers, families (with kids).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015', NULL, 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
(136, 136, 'I''m looking to rent a new fully furnished downtown condo at Yonge and Dundas directly across the street from the Eaton Centre. It is a 1 Bedroom Condo, 1 Bathroom. Open concept living room, laundry, terrace, bright and sunny unit. 550 sq ft. The building is walking distance from everything downtown has to offer. Short term rental option are available. Parking is not included.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1814', NULL, 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
(137, 137, 'New fully furnished downtown condo at Yonge and Dundas directly across the street from the Eaton Centre. It is a 1 Bedroom Studio, 1 Bathroom. Open concept living room, laundry, terrace, bright and sunny unit. 390 sq ft. The building is walking distance from everything downtown has to offer.\r\n\r\nShort term rental option are available. Parking is not included.', NULL, NULL, NULL, NULL, NULL, 'Located right on Yonge Street, Dundas Square is Toronto’s most densely populated neighborhood. It has the advantage of being located within walking distance of the Financial District, the Discovery District, the Hospital District, Toronto City Hall, Ryerson University, the University of Toronto and downtown Yonge Street.', NULL, NULL, '1808', 'Located right on Yonge Street, Dundas Square is Toronto’s most densely populated neighborhood. It has the advantage of being located within walking distance of the Financial District, the Discovery District, the Hospital District, Toronto City Hall, Ryerson University, the University of Toronto and downtown Yonge Street.', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
(138, 138, 'Spacious townhouse. 1 Parking spot included.\r\nComfy couch in living room, 3 Queens and a pull out couch\r\nImmerse yourself in the luxury of this modern design, clean and fresh with all the essentials . Enjoy this stunning suite for a fraction of the cost of a hotel. My place is good for big groups, business travelers & families (with kids).', NULL, NULL, NULL, NULL, NULL, 'CityPlace area with 24 acres of parks and greenspace, fiber optics and over 9 million in public arts in the parks to view. The buildings light up at night to match CN\r\nTower and Skydome / Rogers Centre. Medical and dental facilities, dry cleaning and video, convenience stores and great restaurants, also Tim Hortons and Starbucks, all the banks and Sobeys Supermarket, also right across from the new library just built.', NULL, NULL, 'TH430', 'CityPlace area with 24 acres of parks and greenspace, fiber optics and over 9 million in public arts in the parks to view. The buildings light up at night to match CN\r\nTower and Skydome / Rogers Centre. Medical and dental facilities, dry cleaning and video, convenience stores and great restaurants, also Tim Hortons and Starbucks, all the banks and Sobeys Supermarket, also right across from the new library just built.', 'Wifi network name: Suite#\r\nWifi password: 4167127908'),
