(4, 14, 'HOUSERULES', 'The following rules are in place to keep my properties at their high-end finish and in compliance with rules and regulations in place to ensure the safety of my guests and the legal owners and residents of the building. These rules will restrict certain guests from obvious abuse, they are not intended to disrespect seasoned Airbnb users with great reviews and/or responsible adults. Please do not take offense:\n\n\n1.Absolutely NO PARTIES. NO extra guests without previous notice and NO visitors allowed at any time. Failure to do so will result in the removal of your booking without refund and will evict you and your guests. This is a condominium with owners and full-time tenants, it can not be treated as a party room or meeting point. Respect the rights and peaceful enjoyment of the residents of the building. We do not allow any kind of event, gathering, pre-drinks, etc. Zero tolerance to noisy guests.  If neighbours complain and officials are called in, you may be subject to the ($900) city fine.\n\n\n2.Smoking (or any other smoking-like-activities) is prohibited in the apartment. Smoking allowed in the balcony only (ashtrays provided). Do not throw butts (or anything) off balcony.\nThere will be a fine of $400 if you or your guests smoke inside the unit and at your check out the place is reeking. \n\n\n3.Please use common sense, you and your guests, regarding the use of balconies with respect and not screaming or being loud, electronic wiring, plumbing all sharp objects, appliances etc. Don’t use the balcony after 9pm. Insurance does not cover abuse and situations whereby the guest is not using common sense.\n\n\n4.At all times, CONTACT ME ONLY regarding any questions or issues. The concierge DOES NOT WORK AS A RECEPTIONIST, he works for the full-time tenants only and his duty is not to assist you at all. We will assist at your check in. Check out quietly please.\n\n\n5.Please reduce baggage to a reasonable amount, you may be responsible for any wall damage which has occurred during your stay. \n\n\n6.Please do not wear shoes or boots in the suite and especially on the carpets. Please make sure no one use shoes inside of the house and if you have girls on the group, NO heels at any time, you can imagine how can be for my neighbour below having adults walking with in our condo.\n\n\n7.Don''t lose keys, Fobs or Garage openers, if misplaced or taken home, a locksmith should be called to replace the lock at your cost (up to $375) due safety reasons a protect our home of any risk of a misplaced fob and/or key. We won’t provide a replacement key unless the payment for the misplaced key has been covered first and a deposit of $100 has been given for the second set to give you access to the unit. \n\n\n8.Must disclose damage or disruption during your stay via email message or phone immediately. Items are categorized and accounted for; please do not take any items from the unit including towels and essentials that do not belong to you. Inventory will be taken by the cleaning service. \n\n\n9.Please do not soil linens or towels with makeup /oils or other you will be responsible to repay or replace such items; please treat my home as you would your own. \n\n\n10. Garbage Room is on same floor please help by removing all garbage prior your departure. \n\n\n11.You must present Valid government ID that matches your profile, keys will not be given to your friends and or family and or other individuals to safeguard against fraud.\n\n\n12.Lost and found items will be kept for the next three days after your check out, items not claimed will be disposed or donated to a community centre. I’m not responsible for shipping any forgotten object, you must do all the paperwork and schedule the pick up with the mail carrier.\n\n\n13.In cases that our space requires "deep cleaning" due to extremely messy guests, there will be an additional cleaning fee equal to 100% of our normal cleaning fee that will be charged after the guests'' stay.\n\n\nMi Casa Su Casa, this is your home to return and let others know about, my review will be based on how you live in our home. Unlike a hotel room which is much more expensive for less than half the size, Airbnb only works when we treat each other like family. Enjoy this great suite and location and feel free to call or message me anytime.', '2021-10-05 04:58:33'),
(5, 14, 'check-in', 'We are looking forward to your arrival. Please meet us at 20 Capreol Court (***IT''S A HOUSE NOT A BUILDING ***) for your 5pm check in to pick up the key of your apartment.\n\n\n Please read the next PDF (2 pages) and follow the instructions for your check in at 5pm. \nClick on the link and then swipe left to read the 2nd page. https://view.publitas.com/mi-casa-su-casa/509_web-manual/\n\n\nIf your plans are to arrive later than 5pm please advise us so we can make every attempt to accommodate you.\n\n\nPlease contact us at +1 647 557 2194 if you have any questions.\n-----\n•  Key pick up location:\n20 Capreol Ct \nToronto, ON M5V 4A3\nhttps://goo.gl/maps/KduGfXWC4JeAt35b9\n\n\n*** It''s a townhouse NOT a building***\nJust beside of the main entrance of the building 10 Capreol Court, the 3rd House on the right. \n\n\n\n\n*****PLEASE DO NOT COMMUNICATE WITH SECURITY AND OR BUILDING STAFF unless it is an emergency*****\nSome of our guests have failed to understand the importance of communicating directly with us. \n\n\nID must be provided by the person who made the reservation upon check in.', '2021-10-05 04:57:29');
